INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11005, 1, "ht_ulht_liCarefully crafted pasta needs completely new approach in its‚Äô preparation.d_ht_liht_li Rummo pasta adheres to a Lenta Lavorazione philosophy for exceptional taste of this product.d_ht_liht_liLenta Lavorazione translates into ‚Äúslow cooking‚Äù which is the very natural way of pasta cooking. This method strictly linked to Italian traditions and artisan practices of creating pasta.d_ht_lid_ht_ul" );
