INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11010, 1, "ht_ulht_liWide, flat pasta sheets are one of the main ingreadients to prepare Lasagne.d_ht_liht_liLasagne is originated from Italy and popular all around the globe.d_ht_liht_liRummo Lasagne All' UOVO was prepared with extra care to take your taste buds into middle ages.d_ht_liht_liDish is traditionally made from multiple sheets of lasagne stuffed with sauce, cheese and various ingredients and baked wholly in the oven over period of time.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11011, 1, "ht_ulht_liLupini Beans maybe hard to find but not today!d_ht_liht_liGolosini offers Lupini Beans in brine and will save lots of preparation time in comparison to dry Lupini beans. In general, Lupini beans are reach in protein conceding only to soy beans.d_ht_liht_liIt well known salty snack in Mediterranean region and Portugal (e.g. pairs with beer as it would with bowl of peanuts). Enjoy!d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11012, 1, "ht_ulht_liITALISSIMA Foods is proud to offer wide range of products in Fagioli (‚ÄúBeans native to Italy‚Äù) category.d_ht_liht_liEnough variety to make stews, soups, salads, dips, or just a healthy substitute when craving for snacks.d_ht_liht_liLupini Beans are seeds of plant called Lupinus. These legumes contain high amount of protein, fiber and generous amounts of vitamins.d_ht_liht_liLupini pickles are ideal as a snack.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11013, 1, "ht_ulht_liUsually it is hard to imagine healthy salad full of nutrients without kidney shaped beans.d_ht_liht_liAlthough, it is more common to see salads made with Red Kidney Beans, green kidney beans are also a great choice especially for vegan and vegetarians.d_ht_liht_liJean Nicholas - Green kidney beans are rich in protein and fiber which makes it to the top of the ingredients‚Äô list for next salad you are about to make.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11014, 1, "ht_ulht_liGreen kidney beans have soft taste and firm texture with exceptionaly delicate flavour.d_ht_liht_liThese legumes are great selection for salads that will replenish your energy levels.d_ht_lid_ht_ul  " );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11015, 1, "ht_ulht_liIn need of healthy protein boost for your next meal?d_ht_liht_liWhat can be better that a mixture of beans with all essential nutrients in one place.d_ht_liht_liDelicious mixture of Cannelini Beans, Red Kidney Beans, Butter Beans, Chick Peas, Romano Beans offered by SAN REMO canned and ready to be consumed either as snack or one of the ingredients for main meal.d_ht_liht_liCanned beans are simple and easy solution for quick cold bean salads.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11016, 1, "ht_ulht_liDid you know that tasty hummus dip with silky texture, consists mainly of chickpeas?d_ht_liht_liOrganic Chick peas are all-round alternative as an ingredient and deserves to be in the list ingredients for most of the food recipes. For instance, one can roast them, boil them and eat as a simple snack, add them to soup and more.d_ht_liht_liThere are numerous ways to enjoy SAN REMO ‚Äì Chick peas and Sweet Potato-Chickpea Patties with Sriracha-Yogurt Dip is one of them.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11017, 1, "ht_ulht_liSimple, convenient and most importantly nutritious item with long shelf life.d_ht_liht_liCanned Red Kidney beans are great way to avoid all the hassle of rehydration in the case of dried red kidney beans.d_ht_liht_liThese legumes are ideal suit for rice dishes, soups, salads, dips stews etc.d_ht_liht_liSAN REMO - Red Kidney Beans made from selected organic beans and carefully conserved in convenient sized cans for you to enjoy.d_ht_lid_ht_ul " );
