INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11115, 7, "ht_ulht_bPanko Crusted Baked Shrimp Ingredients:d_ht_bht_liht_em1-1/2 cupsd_ht_em  Preferisco Panko Bread Crumbs;d_ht_li ht_liht_em2d_ht_em large eggs;d_ht_li ht_liht_em1 tbspd_ht_em fat-free milk;d_ht_liht_liht_em3 tbspd_ht_em all-purpose flour;d_ht_liht_liht_em2 tbspd_ht_em parsley, chopped;d_ht_liht_liht_em1/4 tspd_ht_em pepper;d_ht_liht_liht_em30d_ht_em uncooked large shrimps, peeled & deveined;d_ht_liht_liolive oil cooking spray.d_ht_lid_ht_ulht_bDirectionsd_ht_bht_ulht_liPlace bread crumbs in a bowl. In another bowl, combine egg whites and milk. In a third bowl, combine flour, parsley, salt and pepper. Dip shrimp in the flour, egg mixture and then bread crumbs.d_ht_liht_liPlace shrimp on a baking tray covered with cooking spray; spritz shripms with olive oil spray. Bake at 400¬∞F  for 8-12 minutes.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11117, 7, "ht_ulht_bCrunchy Fried Shrimp Ingredients:d_ht_bht_liht_em3 d_ht_emlarge eggsd_ht_liht_liht_em1/3 cup d_ht_emall-purpose flourd_ht_liht_liht_em3/4 tsp d_ht_emsaltd_ht_liht_liht_em1/2 tsp d_ht_emblack pepperd_ht_liht_liht_em500gm d_ht_emjumbo raw shrimp, peeled and deveined, leaving tails ond_ht_liht_liht_em1-1/2 cups d_ht_emKikkoman Panko Bread Crumbsd_ht_liht_livegetable oild_ht_lid_ht_ulht_bDirections:d_ht_bht_ulht_liBeat eggs in a medium bowl until frothy. Mix flour, salt and pepper in another medium bowl. Dredge shrimp in flour mixture. Dip shrimp into eggs and then coat both sides with Panko, pressing Panko onto shrimp.d_ht_liht_liPour enough oil into large, heavy pot to reach depth of 5 cm and heat to 177¬∞C (350¬∞F).d_ht_liht_liAdd shrimp to hot oil and deep-fry until cooked through, about 1 minute. Remove and drain shrimp on paper towels.d_ht_liht_liMakes 3 to 4 servings.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11118, 7, "ht_ulht_bBaked Garlic Parmesan Chicken:d_ht_bht_li<em>2 tbsp </em>Extra Virgin Olive Oild_ht_liht_li<em>1 </em>garlic mincedd_ht_liht_li<em>2 tbsp </em>parsley, choppedd_ht_liht_li<em>1/4 tsp </em>saltd_ht_liht_li<em>1/4 tsp </em>pepperd_ht_liht_li<em>1 cup </em>PREFERISCO Seasoned Bread Crumbsd_ht_liht_li<em>1/2 cup </em>grated Parmesan cheesed_ht_lid_ht_ul6 </em>skinless, boneless chiken breastd_ht_liht_bDirections:d_ht_bht_ulht_liPreheat oven to 177¬∞C (350¬∞F).d_ht_liht_liIn a bowl, blend the olive oil and garlic. In a separate bowl mix bread crumbs, Parmesan cheese, parsley and pepper. Dip each chiken breast into mixture, then in bread crumbs. Arrange coated chicken breast in prepared baking dish, and top with remaining bread crumbs.d_ht_liht_liBake in 30 minutes in the preheated oven.d_ht_liht_liEnjoy!d_ht_lid_ht_ul" );
