INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES (1309, 7, "ht_bHorseradish Beer Cheesed_ht_bDirections: ht_ulht_liIn bowl, stir together bacon, sour cream, mayonnaise, horseradish, lemon juice, Worcestershire sauce and salt (optional)d_ht_liht_liMelt butter in a saucepan set over medium heat. Add flour, garlic, Worcestershire sauce and mustard; cook stirring constantly, for 1 minuted_ht_liht_liGradually whisk in beer. Bring to a gentle simmer. Reduce heat to low. Whisk in sour cream until well combined and heated through. Gradually whisk in cheese until melted. Season with pepper (adjust to taste). Serve warm, in a chafing dish, with dippers on the sided_ht_lid_ht_ulIngredients:ht_ulht_li1 tbsp (15 mL) Butterd_ht_liht_li1 tbsp (15 mL) All Purpose Flourd_ht_liht_li1 Garlic Clove gratedd_ht_liht_li2 tsp (10 mL) Worcestershire Sauced_ht_liht_li1/4 cup (50 mL) Sour Creamd_ht_liht_li2 cups (500 mL) Ivanhoe Horseradish Cheddar d_ht_lid_ht_ul");
